(ainsi que perdre mon temps à regarder la pluie tomber).</blockquote>\r\n...ou bien quelque chose comme cela :\r\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis cette année. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\r\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href=\"http://192.168.33.10/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !','Page d’exemple','','inherit','closed','closed','','2-revision-v1','','','2018-01-25 16:27:42','2018-01-25 15:27:42','',2,'http://192.168.33.10/index.php/2018/01/25/2-revision-v1/',0,'revision','',0),(32,1,'2018-01-25 16:28:52','2018-01-25 15:28:52','','Présentation animaux','','inherit','closed','closed','','6-revision-v1','','','2018-01-25 16:28:52','2018-01-25 15:28:52','',6,'http://192.168.33.10/index.php/2018/01/25/6-revision-v1/',0,'revision','',0),(33,1,'2018-01-25 16:35:24','2018-01-25 15:35:24','','Présentation animaux','','inherit','closed','closed','','6-revision-v1','','','2018-01-25 16:35:24','2018-01-25 15:35:24','',6,'http://192.168.33.10/index.php/2018/01/25/6-revision-v1/',0,'revision','',0),(34,1,'2018-01-25 16:37:07','2018-01-25 15:37:07','','Présentation animaux','','inherit','closed','closed','','6-revision-v1','','','2018-01-25 16:37:07','2018-01-25 15:37:07','',6,'http://192.168.33.10/index.php/2018/01/25/6-revision-v1/',0,'revision','',0),(35,1,'2018-01-25 16:53:08','2018-01-25 15:53:08','','Home','','trash','closed','closed','','home__trashed','','','2018-01-25 17:03:59','2018-01-25 16:03:59','',0,'http://192.168.33.10/?page_id=35',0,'page','',0),(36,1,'2018-01-25 16:53:08','2018-01-25 15:53:08','','Home','','inh